#chartPopup {
  position: absolute;
  top: 100px;
  left: 100px;
  background: #fff;
  border: 1px solid #ccc;
  box-shadow: 0 2px 2px rgba(0,0,0,0.3);
  border-radius: 2px;
  width: 180px;
  height: 80px;
  margin-left: -90px;
  margin-top: 20px;
  padding: 10px 5px;
  display: none;
  text-align: center;
}
#chartTitle {
  height: 20px;
  font-size: 1.2em;
  font-weight: bold;
}
#chartTime {
  font-weight: bold;
  font-size: 0.8em;
  margin-bottom: 5px;
}

#chartValue {
  font-size: 0.9em;
}

