module = {};
module.exports = plotdb.chart.create({
  name: "New Chart",
  title: "New Chart",
  desc: "No Description",
  author: "Your Name",
  ref: "http://www.nytimes.com/interactive/2015/04/03/sports/baseball/mlb-records.html",
  sample: d3.range(1000).map(function(it) {
    var names = ["Simon","James","John","Amelie","Eva","Sharon","Justin","Andy","Smith"];
    var seed = Math.random();
    var time = parseInt(seed * 100 + 1900);
    var range = seed * 20 + 5;
    var delta = seed * 10;
    var value = parseInt(Math.sin(seed * 6.28 * 4) * delta + 2 * delta) + parseInt(Math.random()*range - range/2) + range / 2;
    return {time: time, value: value, name: names[parseInt(Math.random()*names.length)]};
  }),
  dimension: {
    value: { type: [plotdb.Number], require: true, desc: "value (y-axis)" },
    time: { type: [plotdb.Number], require: true, desc: "time (x-axis)" },
    name: { type: [], require: false, desc: "name for this event" }
  },
  config: {
    padding: { type: [plotdb.Number], default: 10, rebindOnChange: true },
    radius: { type: [plotdb.Number], default: 5, rebindOnChnage: false},
    highColor: {type: [plotdb.Color], default: "rgba(206,122,156,0.8)"},
    baseColor: {type: [plotdb.Color], default: "#000"},
    hoverColor: {type: [plotdb.Color], default: "#000"},
    lineAlwaysOn: {type: [plotdb.Boolean], default: true}
  },
  init: function() {
    var that = this;
    this.svg = d3.select(this.root).append("svg")
    if(!this.data || !this.data.length) this.data = this.sample;
    hash = {}
    this.data.forEach(function(it) {
      if(!hash[it.time]) hash[it.time] = {}
      if(!hash[it.time][it.value]) hash[it.time][it.value] = {
        name: it.name, time: it.time, value: it.value, count: 0
      };
      hash[it.time][it.value].count++;
    });
    ret = []
    for(time in hash) {
      for(value in hash[time]) {
        ret.push(hash[time][value]);
      }
    }
    this.data = data = ret;
    this.times = data.map(function(it) { return it.time; });
    this.values = data.map(function(it) { return it.value; });
    this.counts = data.map(function(it) { return it.count; });
    for(var byYear,last = null, idx = 0, max = d3.min(this.values); idx < this.times.length; idx ++ ){
      byYear = data.filter(function(it){return it.time==that.times[idx]});
      byYear.sort(function(a,b) { return b.value - a.value; });
      if(!byYear[0]) { continue; }
      byYear[0].yearHigh = true;
      if(byYear[0].value > max) {
        if(last) { 
          last.next = byYear[0];
          byYear[0].prev = last;
        }
        last = byYear[0];
        last.recordHigh = true;
        max = last.value;
        last.next = last;
      }
    }    
    data.sort(function(a,b) { return a.time - b.time;});
    this.xticks = this.svg.append("g").attr({class: "xticks"});
    this.yticks = this.svg.append("g").attr({class: "yticks"});
    this.legend = this.svg.append("g").attr({class: "legend"});
    this.legend.append("circle").attr({
      class: "legend"
    });
    this.legend.append("text").attr({
      class: "legend",
      "dominant-baseline": "central",
      "text-anchor": "start",
      "font-size": 12
    }).text("Record Highest");
  },
  bind: function() {

    var data = this.data;
    var that = this;
    this.cscale = d3.scale.linear().domain(d3.extent(that.counts)).range([0.4, 0.8]);
    this.dots = this.svg.selectAll("circle.dot").data(data);
    this.dots.enter().append("circle").attr({"class": "dot"});
    this.dots.exit().remove();
    this.lines = this.svg.selectAll("line.extend").data(data.filter(function(it) { return it.recordHigh; }));
    this.lines.enter().append("line").attr({"class": "extend"});
    this.svg.on("mousemove",function() {
      var x = d3.event.clientX;
      var y = d3.event.clientY;
      var rx = x;
      var ry = y;
      var time = 0;
      var value = 0;
      x = that.xscale.invert(x);
      y = that.yscale.invert(y);
      for(var idx = 0, min = -1; idx < that.times.length; idx++ ) {
        d = Math.abs(that.times[idx] - x);
        if(d < min || min == -1) { min = d; time = that.times[idx]; }
      }
      values = d3.keys(hash[time]);
      for(var idx = 0, min = -1; idx < values.length; idx++ ) {
        d = Math.abs(values[idx] - y);
        if(d < min || min == -1) { min = d; value = values[idx]; }
      }
      target = hash[time][value];
      if(that.hover) { that.hover.hover = false; }
      if(target) { target.hover = true; }
      that.hover = target;
      that.render(that.root,that.data,that.config);
      if(target) {
        d3.select("#chartPopup").style({
          display: "block",
          top: ry + "px",
          left: rx + "px"
        });
        d3.select("#chartTitle").text(target.name);
        d3.select("#chartTime").text(parseInt(100 * target.time)/100);
        d3.select("#chartValue").text(parseInt(100 * target.value)/100);
      }
    });
  },
  resize: function() {
    var w = $(this.root).width();
    var h = $(this.root).height();
    var that = this;
    this.mw = 20;
    this.mh = 20;
    this.w = w;
    this.h = h;
    this.svg.attr({
      width: "100%",
      height: "100%",
      viewBox: [0,0,w,h].join(" "),
      preserveAspectRatio: "xMidYMid"
    });
    var config = this.config;
    this.yscale = d3.scale.linear().domain([0,d3.max(that.values)]).range([that.h - 2 * that.mh,2 * that.mh]);
    var ytick = that.yscale.ticks(3);
    this.lwm = 12 * d3.max(ytick.map(function(it) { return (it + "").length; }));
    this.xscale = d3.scale.linear().domain(d3.extent(that.times)).range([that.mw, that.w - 2 * that.mw - this.lwm]);
    var update = this.xticks.selectAll("g.xtick").data(this.xscale.ticks(10));
    update.exit().remove();
    update.enter().append("g").attr({
      class: "xtick"
    }).each(function() {
      d3.select(this).append("text")
        .text(function(it) { return it;})
        .attr({
          fill: "#999",
          dx: 5,
          "font-size": 12
        });
      d3.select(this).append("line").attr({
        x1: 0,
        y1: 2,
        x2: 0,
        y2: -10,
        stroke: "#999",
        "stroke-width": 1
      });
    });

    update = this.yticks.selectAll("g.ytick").data(ytick);
    update.exit().remove();
    update.enter().append("g").attr({
      class: "ytick"
    }).each(function() {
      d3.select(this).append("text").text(function(it) {
        return it;
      }).attr({
        fill: "#999",
        "dominant-baseline": "central"
      });
      d3.select(this).append("line").attr({
        x1: -that.mw + config.radius,
        x2: -that.w + that.lwm + that.mw * 2 - config.radius,
        y1: 0,
        y2: 0,
        stroke: "#999",
        "stroke-width": 1,
        "stroke-dasharray": "1 3"
      });
    });
  },
  render: function() {
    var that = this;
    var config = this.config;
    this.svg.select("circle.legend").attr({
      cx: this.mw + config.radius,
      cy: this.mh + config.radius,
      r: config.radius,
      fill: config.highColor
    });
    this.svg.select("text.legend").attr({
      x: this.mw + config.radius * 3,
      y: this.mh + config.radius,
      fill: config.baseColor
    });
    this.svg.attr({
      viewBox: [0,0,that.w,that.h].join(" ")
    });
    this.svg.selectAll("g.xtick").attr({
      transform: function(it) {
        return "translate("+(that.xscale(it))+","+(that.h - that.mh)+")";
      },
    });
    this.svg.selectAll("g.ytick").attr({
      transform: function(it) {
        return "translate("+(that.w - that.mw - that.lwm)+","+that.yscale(it)+")";
      }
    });
    this.svg.selectAll("line.extend").attr({
      x1: function(it) { return that.xscale(it.time); },
      x2: function(it) { return that.xscale(it.next.time); },
      y1: function(it) { return that.yscale(it.value); },
      y2: function(it) { return that.yscale(it.value); },
      stroke: config.highColor,
      "stroke-width": 1,
      opacity: function(it) {
        if(!config.lineAlwaysOn) { if(it.hover) return 1; else return 0; }
        return 1;
      }
    });
    this.svg.selectAll("circle.dot").attr({
      cx: function(it) { return that.xscale(it.time); },
      cy: function(it) { return that.yscale(it.value); },
      r:  function(it) { 
        if(it.hover) { return config.radius * 2; }
        return config.radius;
      },
      fill: function(it) {
        if(it.recordHigh) { return config.highColor; }
	    if(it.hover) { return config.hoverColor; }
        return config.baseColor;
      },
      opacity: function(it) {
        if(it.hover || it.recordHigh) { return 1;}
        return that.cscale(it.count);
      }
    })
  }
});
